export const getCartData = async () => {
  let data = []
  try {

    const res = await fetch("../public/mocks/cart.json", {
      headers: {
        'Cache-Control': 'no-cache', // Disable caching
        'Pragma': 'no-cache',
        'Content-Type': 'application/json'
      },
    })
    data = await(res?.json)
  }
  catch (error) {
    console.log(error)
  }
  return data
}
